// PropertySearch.js
import { Button, Container, Grid, MenuItem, TextField } from '@mui/material';
import React from 'react';

const cities = ['City 1', 'City 2', 'City 3'];
const propertyTypes = ['House', 'Apartment', 'Condo'];

const Propertysearch = () => {
  return (
    <Container maxWidth="md">
      <Grid container spacing={3}>
        <Grid item xs={12} sm={6} md={3}>
          <TextField select label="City" fullWidth variant="outlined">
            {cities.map((city) => (
              <MenuItem key={city} value={city}>
                {city}
              </MenuItem>
            ))}
          </TextField>
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <TextField
            type="date"
            label="Move-in Date"
            fullWidth
            InputLabelProps={{
              shrink: true,
            }}
            variant="outlined"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <TextField select label="Select Price Range" fullWidth variant="outlined">
            {/* Add price range options */}
          </TextField>
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <TextField select label="Property Type" fullWidth variant="outlined">
            {propertyTypes.map((type) => (
              <MenuItem key={type} value={type}>
                {type}
              </MenuItem>
            ))}
          </TextField>
        </Grid>
        <Grid item xs={12}>
          <Button variant="contained" color="primary" fullWidth>
            Search
          </Button>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Propertysearch;
